import Div from "../div/div"
import Image from "../image/images"

const Card = ({className})=>{
    return (
        <div className={className}>
            <Image urlImage="../src/components/card/HB_LOGO1.png" classImage="image--left" textAlt="Logo Hb"/>
            <Div ClassDiv="div--left"/>
        </div>
    );
}
export default Card;
